import React from "react";
import { TOTAL__SCREENS } from "../utilities/commonUtils";

export default function PixelVenturesContainer() {
  const mapAllScreens = () => {
    TOTAL__SCREENS.map((screen) =>
      screen.component ? (
        <screen.component
          screenName={screen.screen_name}
          key={screen.screen_name}
          id={screen.screen_name}
        />
      ) : (
        <div key={screen.screen_name}></div>
      )
    );
  };

  return <div className="mainContainer">{mapAllScreens()}</div>;
}
